import React from 'react'
import Navigation from './views/navigation/navigation'
import HomePage from './views/homepage/homepage';
import './App.css';

export class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Navigation />
        <HomePage />
      </div>
    );
  }
}

export default App;
